import { useState } from "react";
import "./HateListItem.scss";

export const HateListItem = ({ item }) => {
  const [isChecked, setIsChecked] = useState(false);

  const handleClick = () => {
    setIsChecked(!isChecked);
  };

  return (
    <li onClick={() => handleClick()}>
      <span>{item}</span>
      <div className="checkbox" />
    </li>
  );
};
